import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AwesomeSlider from 'react-awesome-slider';

import './App.css';

const App = () => {
  return (
    <Router>
      <Fragment>
        <div className='container'>
          <Switch></Switch>
        </div>
      </Fragment>
    </Router>
  );
}

export default App;
